/* eslint-disable import/prefer-default-export */
import styled from 'styled-components';

export const Input = styled.input`
    max-height: 32px;
    min-height: 32px;

    width: 650px;
    border:1px solid #000;
    border-radius:5px;
    margin:3px 2%;
    padding: 0 9px;
    }
`;
